(62, 'Auditoria  de  máquina', 'Carregamento  de  Gás', 'Inspeção de equipamento elétrico', 'Condição de aterramento da rede elétrica.Sem deterioração calor nos fios e conexões\r\nNenhum dano, tais como marcas de arame, tampa do peeling\r\nVários condições de operação S / W\r\n(Nenhum conserto forçado e uso incorreto)\r\nSegurança S/W alterada deve estar trabalhando adequadamente e não ser usada de modo incorreto.\r\n\r\n', 'S'),
(63, 'Auditoria  de  máquina', 'Carregamento  de  Gás', 'Listas de verificação de gestão das instalações e vários anexos', 'Verificação deve ser conduzida pelo padrão e registrar o resultado de verificação\r\nAnexos não devem ter danos, poluição.\r\n\r\n', 'S'),
(64, 'Auditoria  de  máquina', 'LQC', 'Condição de operação normal de vários dispositivos de energia', 'Condição de aterramento da linha de energia\r\nSem deterioração de calor nos fios e conexões,Sem dano, como fios marcados, tampas descascadas\r\nCondição de operação S / W alterada.(Sem conserto forçado e uso incorreto)\r\nSegurança S / W variada deve ser trabalhada adequadamente e não usada de modo incorreta', 'S'),
(65, 'Auditoria  de  máquina', 'LQC', 'Inspeção de equipamento elétrico', 'Condição de aterramento da linha de energia\r\nSem deterioração de calor nos fios e conexões\r\nSem dano, como fios marcados, tampas descascadas\r\nCondição de operação S / W variada\r\n(Sem conserto forçado e uso anormal)\r\nSegurança S / W variada deve ser trabalhada adequadamente e não usada de modo incorreto', 'S'),
(66, 'Auditoria  de  máquina', 'LQC', 'Verificar os pneumáticos', 'Sem vazamento do tubo, válvulas de controle, etc. e deve ser fixado.\r\nSem vazamento, desgaste, danos em todas as unidades de acionamento.\r\nSem deformação nas peças consertadas devido folga.\r\nSilenciador deve ser instalado no sistema de ventilação de ar.', 'S'),
(67, 'Auditoria  de  máquina', 'LQC', 'Listas de verificação de gestão das instalações e vários anexos', 'Verificação deve ser conduzida pelo padrão e registrar o resultado da verificação.\r\nAnexos não podem ter dano, poluição.', 'S'),
(68, 'Auditoria  de  máquina', 'Soldagem', 'Operação normal, a presença ou ausência  de vários dispositivos energizados.', 'Checar condição de lubrificação de várias unidades de acionamento\r\n(Sem folga, desgaste anormal, ruído, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) não devem ficar solta\r\nDispositivo de proteção das peças de rotação deve ser ajustado\r\nUnidade de rotação deve ser mantida limpa (Sem sujeira, peças variadas, etc).\r\n', 'S'),
(69, 'Auditoria  de  máquina', 'Soldagem', 'Inspeção de equipamento elétrico', 'Checar condição de lubrificação de várias unidades de acionamento\r\n(Sem folga, desgaste irregular, ruído, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) não deve ficar solta\r\nDispositivo de proteção das peças de rotação deve ser ajustado\r\nUnidade de rotação deve ser mantida limpa . (Sem sujeira, peças variadas, etc).\r\n', 'S'),
(70, 'Auditoria  de  máquina', 'Soldagem', 'Checar os pneumáticos', 'Sem vazamento do tubo, válvulas de controle, etc. e deve ser fixado\r\nSem vazamento, desgaste, danos em todas as unidades de acionamento\r\nSem deformação nas peças consertadas devido folga\r\nSilenciador deve ser instalado no sistema de ventilação de ar\r\n\r\n', 'S'),
(71, 'Auditoria  de  máquina', 'Soldagem', 'Verificação da unidade de grampo', 'Sem defeito da unidade deficiente de Grampo\r\n\r\n', 'S'),
(72, 'Auditoria  de  máquina', 'Soldagem', 'Listas de verificação de gestão das instalações e vários anexos', 'Verificação deve ser conduzida pelo padrão e registrar o resultado da verificação\r\nAnexos não podem ter dano, poluição.', 'S'),
(73, 'Auditoria  de  máquina', 'Embalagem', 'Operação normal, a presença ou ausência  de vários dispositivos energizados', 'Checar condição de lubrificação de várias unidades de acionamento\r\n(Sem folga, desgaste anormal, ruído, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) não deve ficar solta\r\nDispositivo de proteção das peças de rotação deve ser ajustado\r\nUnidade de rotação deve ser mantida limpa . (Sem sujeira, peças variadas, etc)\r\n', 'S'),
(74, 'Auditoria  de  máquina', 'Embalagem', 'Inspeção de equipamento elétrico', 'Condição de aterramento da linha de força\r\nSem deterioração de calor nos fios e conexões\r\nSem dano, como fios marcados, tampas descascadas\r\nCondição de operação S / W variada\r\n(Sem conserto forçado e uso anormal)\r\nSegurança S / W variada deve ser trabalhada adequadamente e não usada de modo errado', 'S'),
(75, 'Auditoria  de  máquina', 'Embalagem', 'Listas de verificação de gestão das instalações e vários anexos', 'Verificação deve ser conduzida pelo padrão e registrar o resultado da verificação\r\nAnexos não podem ter dano, poluição', 'S');










































