(2, 'Auditoria de ciclo', 'Soldagem forte', 'EVA/Cond trocador de calor com grampo', 'Nenhuma exposição de barbante dentro do tubo de 10㎜↓', 'D'),
(3, 'Auditoria de ciclo', 'Soldagem forte', 'Remoção do tampão(tapulho) EVA/Cond', 'Soldagem dentro de 30 min após remover tampão(tapulho) ', 'D'),
(4, 'Auditoria de ciclo', 'Soldagem forte', 'Inserir nitrogênio', 'Verificação de linha  parada se nitrogênio não estava inserido\r\n- Interior/Exterior (Pequeno) : 3 Segundos↑\r\n- Exterior (UE1,U4) : 6 Segundos↑', 'D'),
