(13, 'Auditoria de ciclo', 'Vácuo', 'Nível de vácuo', 'Vácuo: 0.05 Torr↓, [Checar todos os níveis de vácuo da bomba de vácuo]', 'D'),
(14, 'Auditoria de ciclo', 'Vácuo', 'Minha Máquina (My Machine)', 'Checar condição de atualização da  folha de verificação(do My Machine / TPM)', 'D'),
(15, 'Auditoria de ciclo', 'Charge machine', 'Pressão do Gás', 'He/ RAC12±2kgf/㎠ R22:20±2kgf/㎠,  R410A:30±2 kgf/㎠', 'D'),
(16, 'Auditoria de ciclo', 'Charge machine', 'Quantidade de Gás [RAC]', 'Verificação de Tempo da quantidade de Gás & ±5g↓', 'D'),
(17, 'Auditoria de ciclo', 'Charge machine', 'Carregamento Manual', 'Auto carregamento', 'D'),
