(19, 'Auditoria de ciclo', 'Charge machine', 'Minha Máquina (My Machine/TPM)', 'Checar condição de atualização da Minha Máquina (do My Machine / TPM)', 'D'),
(20, 'Auditoria de ciclo', 'Vedação', 'Pressão de Ar', 'Pressão de Ar 4.5bar↑(Nova: 6.0bar↑)', 'D'),
(21, 'Auditoria de ciclo', 'Vedação', 'Verificar condição do tempo de soldagem', 'Condição de verificação do tempo de soldagem', 'D'),
