(24, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Limpeza da sala de teste vazamento', 'Operar condição de instalações de ventilação forçadas', 'D'),
(25, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Sensibilidade do Testador de Vazamento', 'Verificar a condição de escrita  da Folha de Verificação CTP\r\nGás: Dados principais do gás ± 3.2g/Y HE : 2.0 X E-5 Mbar·l /Seg\r\n', 'D'),
(26, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Sensibilidade do Testador de Vazamento', 'Checar condição dos instrumentos da lista de verificação', 'D'),
(27, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Quantidade de gás', 'Especificação da quantidade de gás [Teste de auditoria],Comparar a folha de verificação de manufatura & Dados de medição de auditoria', 'D'),
(28, '6 Ferramentas', 'ESD', 'Traje de eletricidade antiestática(Pulseira Fool proof)', 'Checar pulseira, tornozeleira, traje antiestático e  linha para se não usar o equipamento antiestático/medição placa sus/cortina esd/corrente carros', 'D'),
(29, '6 Ferramentas', 'LQC', 'Suporte de teste de tensão / Teste de continuidade de Terra', 'Checar especificação de medição de dados definidos \r\n- Tensão de suporte: AC 1000 V / 10mA↓ / 1s\r\n- Isolamento: DC 500V / 25MΩ↑ / 1s\r\n- Continuidade de terra: 25A / 0.2Ω↓ / 1s\r\n(padrão 0.1Ω + resistência de linha 0.1Ω)\r\n', 'D'),
(30, '6 Ferramentas', 'LQC', 'Teste de fuga de corrente', 'Checar especificação de medição de dados definidos\r\n- Liga/Desliga (On/Off) : 0.75mA ↓\r\n- Inversor: 1.0mA/kW↓ (Max 5mA↓)\r\n', 'D'),
(31, '6 Ferramentas', 'LQC', 'Instrumentos definidos em LQC', 'Condição de operação dos instrumentos definidos em LQC  (Atualização de folha de verificação)', 'S'),
(32, '6 Ferramentas', 'Aparência', 'Etiqueta BOX & Faixa PP', 'Fixação de etiqueta & condição de fixação da faixa PP (checar 1 pálete por linha)\r\n- Etiqueta desalinhada, danificada, com falha (Gap)( faixa PP ~ Etiqueta)', 'D'),
(33, '6 Ferramentas', 'Aparência', 'Etiqueta correspondente', 'A linha para se NG (verificação de falta & uso incorreto)\r\n- Qualidade, etiqueta de energia (Stand by), etc.', 'D'),
(34, '6 Ferramentas', 'Aparência', 'Acessório correto', 'Linha para caso NG (verificação de falta & uso incorreto)', 'D'),
(35, '6 Ferramentas', 'CTQ/CTP', 'Válvula de bloqueio de torque LQC SVC ', 'Especificação de Torque & atualização da folha  de verificação (10ea / semana)\r\n- Φ6.35 : 70+20 kgf·cm      Φ9.52 : 90+30 kgf·cm\r\n- Φ12.7 : 110+30 Kgf·cm    Φ15.88 : 130+30 kgf·cm\r\n', 'D'),
(36, '6 Ferramentas', 'CTQ/CTP', 'Válvula de bloqueio de torque LQC SVC ', 'Atualização da folha de verificação', 'S'),
(37, '6 Ferramentas', 'Verificação de Tempo', 'Verificação da faixa PP (adesão)', 'Atualização da folha de verificação', 'S'),
(38, '6 Ferramentas', 'Auditoria - Q', 'Uso incorreto de peça', 'Verificar placa de mudança de modelo', 'D'),
(39, '6 Ferramentas', 'Auditoria - Q', 'Jig de verificação de gap CFF', 'Verificar se linha para se não usar o jig CFF', 'D'),
(40, '6 Ferramentas', 'Auto&Sequência', 'Inspeção Auto & Seqüencial', 'Verificar se quadro de avisos está atualizado(teia)\r\n', 'D'),
(41, '6 Ferramentas', 'OS&D', 'OS&D armazenamento & etiqueta', 'Manter peças OS&D na bancada durante no Maximo dia e colar etiqueta de identificação', 'D'),
(42, '6 Ferramentas', 'Reunião da qualidade', 'Reunião de revisão de qualidade de meio-dia', 'Verificar maior defeito do dia anterior(avisar na reunião)', 'D'),
(43, 'Cumprimento  do trabalho', '4M', 'Pessoa', 'Relatório de mudança 4M do processo principal & lista de treinamento educacional (Processo principal: Soldagem forte,Carregamento,Vedação, Vazamento, Fiação)\r\n', 'S'),
(44, 'Cumprimento  do trabalho', 'Padrão de Trabalho', 'Manual de instrução de trabalho / Esquema de processo QC', 'Manter condição na linha (baseado na farramenta de produção atual)', 'S'),
(45, 'Cumprimento  do trabalho', 'Padrão de Trabalho', 'Manual de inspeção', 'Manter condição na linha (Nova ferramenta de produção)', 'S'),
(46, 'Segurança', 'Epi\'s', 'Layout das luvas', 'Usar os epi\'s de acordo com a instrução de trabalho em cada posto', 'S'),
(47, 'Auditoria  de  máquina', 'Máquina  de  dobrar EVA/Cond', 'Condição de operação normal de vários dispositivos de energia', 'Checar condição de lubrificação de várias unidades de acionamento.\r\n(Nada solto, traje anormal, ruído, calor, etc )\r\n', 'S'),
(48, 'Auditoria  de  máquina', 'Máquina  de  dobrar EVA/Cond', 'Inspeção de equipamentos elétricos', 'Condição de aterramento da Linha de Força\r\nNenhuma deterioração de calor em fios e conexões\r\nNenhum dano, como marcas nos fios, tampas descascando\r\n', 'S'),
(49, 'Auditoria  de  máquina', 'Máquina  de  dobrar EVA/Cond', ' Dispositivo verificação de óleo pneumático', 'Sem vazamento do tubo, controle de válvulas,  etc. e deve ser consertado.\r\nSem vazamento, desgaste, danos em todas as unidades de condução.\r\n\r\n', 'S'),
(50, 'Auditoria  de  máquina', 'Máquina  de  dobrar EVA/Cond', 'Listas de verificação de gerenciamento  de equipamento e vários anexos', 'Listas de verificação de gerenciamento de equipamento e vários anexos\r\n', 'S'),
(51, 'Auditoria  de  máquina', 'Linha  de  vácuo', 'Operação normal de vários dispositivos de energia', 'Sem folga, desgaste anormal, ruído, calor, etc', 'S'),
(52, 'Auditoria  de  máquina', 'Linha  de  vácuo', 'Verificação do suprimento de energia', 'Sem dano no suprimento de energia. Mantê-lo limpo', 'S'),
(53, 'Auditoria  de  máquina', 'Linha  de  vácuo', 'Verificação da gestão de bomba de vácuo (Óleo,Filtro,Mangueira, etc.)', 'Lubrificante (óleo por vácuo) não deve estar com a cor diferente devido poluição e deterioração,\r\nSem vazamento do corpo da unidade,lubrificante manterá os níveis do padrão.\r\nFiltro na linha não está contaminado.', 'S'),
(54, 'Auditoria  de  máquina', 'Linha  de  vácuo', 'Listas de verificação de gestão  de equipamento e vários anexos', 'Verificação deve ser conduzida pelo padrão e registrar o resultado da verificação,anexos não devem ter danos, poluição.\r\n', 'S'),
(55, 'Auditoria  de  máquina', 'Linha  Principal', 'Condição normal de operação  de vários dispositivos de energia', 'Checar condição de lubrificação de várias unidades de acionamento\r\n(Sem folga, desgaste anormal, ruído, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) não deve ficar solta\r\nDispositivo de proteção das peças de rotação deve ser ajustado\r\nUnidade de rotação deve ser mantida limpa (Sem sujeira, peças variadas, etc)\r\n\r\n', 'S'),
(56, 'Auditoria  de  máquina', 'Linha  Principal', 'Inspeção de equipamento elétrico', 'Condição de aterramento da linha de energia.\r\nSem deterioração de calor nos fios e conexões.\r\nSem dano, como fios marcados, tampas descascadas.\r\nCondição de operação S / W variada.(Sem conserto forçado e uso anormal)\r\nSegurança S / W variada deve ser trabalhada adequadamente e não usada de modo anormal.\r\n\r\n\r\n', 'S'),
(57, 'Auditoria  de  máquina', 'Linha  Principal', 'Óleo, verificação de pneumáticos', 'Sem vazamento do tubo, válvulas de controle, etc. e deve ser fixado.Sem vazamento,\r\n desgaste, danos em todas as unidades de acionamento.Sem deformação nas peças \r\nconsertadas devido folga,deve ser instalado o silenciador no sistema de ventilação de ar.\r\n\r\n\r\n', 'S'),
(58, 'Auditoria  de  máquina', 'Linha  Principal', 'Listas de verificação de gestão das instalações e vários anexos', 'Verificação deve ser conduzida pelo padrão e registrar o resultado da verificação,anexos não podem ter dano, poluição\r\n\r\n\r\n\r\n', 'S'),
(59, 'Auditoria  de  máquina', 'Carregamento  de  Gás', 'Verificação da gestão da bomba de vácuo  (Óleo,Filtro,Mangueira, etc.)', 'Lubrificante (óleo por vácuo) não deve estar com a cor alterada por poluição e deterioração\r\nSem vazamento do corpo da unidade\r\nLubrificante deve manter os níveis do padrão\r\nFiltro na linha não deve estar contaminado\r\nMedidor de vácuo deve ser mantido no nível normal\r\n\r\n\r\n\r\n', 'S'),
(60, 'Auditoria  de  máquina', 'Carregamento  de  Gás', 'Verificação de óleo de dispositivo pneumático.', 'Nenhum vazamento do tubo, válvulas de controle, etc. e precisam ser consertados\r\nNenhuma vazamento, desgaste, danos em todas as unidades de acionamento\r\nNenhuma deformação nas peças consertadas devido folgas\r\nSilenciador deve ser instalado no sistema de ventilação de ar\r\n\r\n\r\n\r\n', 'S'),
(61, 'Auditoria  de  máquina', 'Carregamento  de  Gás', 'Verificação do sistema de refrigeração', 'Nenhum bloqueio no filtro na linha(A lacuna entre medidor de pressão do lado do suprimento é  2 ~ 3㎏ / ㎠ dentro dos dias),Pressão do suprimento de gás deve atender ao padrão.INSERT INTO `line_audit_results` (`id`, `id_auditoria`, `id_checklist`, `result`, `foto`, `obs`) VALUES
